import { useSpring, animated } from "react-spring";

const FadeIn = ({ ...rest }) => {
  return (
    <animated.div
      style={useSpring({
        opacity: 1,
        from: { opacity: 0 },
      })}
    >
      <div> test</div>
    </animated.div>
  );
};

export default FadeIn;
